import React from "react"
import {
    Typography,
    Button,
    Container,
    Grid
} from "@material-ui/core"
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
    root: {
      flexGrow: 1,
      height: 50,
      backgroundColor: "white",
    },
  }));

export const Header = () => {
    const classes = useStyles();
    return (
        <div className = {classes.root}>
            <Container maxWidth = "md" style = {{backgroundColor: "green", height: "inherit"}}>
                <Grid container>
                    <Grid item xs = {6} className = "header_title">
                        <div style = {{display: "block", float:"left"}}>
                            <Typography variant = "h6">
                                Filebox
                            </Typography>
                        </div>

                    </Grid>
                    <Grid item xs = {6} className = "header_logout">
                        <Button style = {{display: "block", float:"right", paddingTop: 19}}>
                            Signout
                        </Button>
                    </Grid>
                </Grid>
            </Container>
        </div>
    )
}
